import React, { Component } from "react";

class Home extends Component {
  componentDidMount() {
    console.log("Home Loaded");
  }
  render() {
    return (
      <div className="home">
        <h1>Hello, I'm</h1>
        <h1>AMAN KUMAR</h1>
        <h1>
          A{" "}
          <div>
            <div>Front End Web Developer</div>
            <div>
              A Guy Who{" "}
              <div>
                <div>
                  <div>
                    <div>Builds</div>
                    <div>Designs</div>
                  </div>{" "}
                  <div>
                    <div>Websites</div>
                    <div>Web Applications</div>
                  </div>
                </div>
                <div>Still Enjoys Video Games From The 2000's</div>
              </div>
            </div>
          </div>
        </h1>
        <button onClick={() => this.props.navigate("about", 1)}>
          Let's Begin
        </button>
      </div>
    );
  }
}

export default Home;
